import React from 'react'
import Navbar from './components/Navbar/Navbar.js';
import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import Projects from './components/pages/Projects';
import Home from './components/pages/Home';
import Resume from './components/pages/Resume';
import Footer from './components/Footer/Footer.js';
import ProjectOverview from'./components/pages/FeaturedProjects/ProjectOverview.js'
import ThirtyDay from'./components/pages/FeaturedProjects/ThirtyDay.js'

function App() {
  return (
    <>
      <div className="background">
        <div className="page-wrapper">
          <Navbar />
          <Routes>
            <Route path = '/erica-w-fu' exact component={Home}>
              <Route path = '/erica-w-fu' component={ProjectOverview}/>
              <Route path = '/erica-w-fu/ThirtyDayAdulting' component={ThirtyDay}/>
            </Route>
            <Route path = '/Projects' component={Projects}/>
            <Route path = '/Resume' component={Resume}/>
          </Routes>
          <Footer />
        </div>
      </div>
    </>
  );
}


export default App;
